import React from 'react';
import ReactDOM from 'react-dom/client';
import { Provider } from 'react-redux';
import { BrowserRouter as Router } from 'react-router-dom';
import { Amplify } from 'aws-amplify';
import App from './App';
import store from './store';
import './index.css';

// Configure AWS Amplify
// In a real app, these values would come from environment variables
const awsConfig = {
  Auth: {
    region: 'us-east-1',
    userPoolId: 'REPLACE_WITH_COGNITO_USER_POOL_ID',
    userPoolWebClientId: 'REPLACE_WITH_COGNITO_CLIENT_ID',
  },
  API: {
    endpoints: [
      {
        name: 'complianceApi',
        endpoint: 'REPLACE_WITH_API_GATEWAY_URL',
        region: 'us-east-1'
      }
    ]
  }
};

// Comment this out in development mode if you don't have actual AWS resources
// Amplify.configure(awsConfig);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Provider store={store}>
      <Router>
        <App />
      </Router>
    </Provider>
  </React.StrictMode>
);
